const{app:app,BrowserWindow:BrowserWindow,Menu:Menu,shell:shell,dialog:dialog}=require("electron"),path=require("path"),{autoUpdater:autoUpdater}=require("electron-updater"),log=require("electron-log");let mainWindow;function createWindow(){mainWindow=new BrowserWindow({width:1024,height:768,icon:path.join(__dirname,"icon.ico"),webPreferences:{nodeIntegration:!1}}),mainWindow.loadURL("https://www.spinfinite.com");const e=[{label:"Web",submenu:[{label:"Reload",click:()=>mainWindow.reload()},{label:"Back",click:()=>{mainWindow.webContents.canGoBack()&&mainWindow.webContents.goBack()}},{label:"Forward",click:()=>{mainWindow.webContents.canGoForward()&&mainWindow.webContents.goForward()}}]},{label:"Help",submenu:[{label:"Made by Anthony",click:()=>shell.openExternal("https://www.spinfinite.com")}]}],n=Menu.buildFromTemplate(e);Menu.setApplicationMenu(n),autoUpdater.checkForUpdates()}autoUpdater.logger=log,autoUpdater.logger.transports.file.level="info",autoUpdater.on("update-downloaded",(()=>{dialog.showMessageBox({type:"info",title:"Update Ready",message:"A new version of Spinfinite is ready. Restart now to install it.",buttons:["Restart Now"]}).then((()=>{autoUpdater.quitAndInstall(!1,!0)}))})),app.whenReady().then(createWindow);